import React from 'react';

class Loggin extends React.Component{
    render(){
        const showStart = this.props.showStart;
        return(
            <div>
            {showStart}
                <br/>
                <input>Användarnamn</input>
                <input>Lösenord</input>
                <button onClick>Tryck här!</button>
            </div>
        );
    }
}

export default Loggin;
